unit.typedef:
typedef struct AVCAST5 {
uint32_t Km[17];
uint32_t Kr[17];
int rounds;
} AVCAST5;

function.block:
{
uint8_t newKey[16];
int i;
uint32_t p[4], q[4];
if (key_bits % 8 || key_bits < 40 || key_bits > 128)
return AVERROR(EINVAL);
memset(newKey, 0, sizeof(newKey));
memcpy(newKey, key, key_bits >> 3);

cs->rounds = key_bits <= 80 ? 12 : 16;
for (i = 0; i < 4; i++)
q[i] = AV_RB32(newKey + (4 * i));
generate_round_keys(cs->rounds, cs->Km, q, p);
generate_round_keys(cs->rounds, cs->Kr, q, p);
for (i = 0; i <= cs->rounds; i++)
cs->Kr[i] = cs->Kr[i] & 0x1f;
return 0;
}

{
int i;
while (count--) {
if (decrypt) {
decipher(cs, dst, src, iv);
} else {
if (iv) {
for (i = 0; i < 8; i++)
dst[i] = src[i] ^ iv[i];
encipher(cs, dst, dst);
memcpy(iv, dst, 8);
} else {
encipher(cs, dst, src);
}
}
src = src + 8;
dst = dst + 8;
}
}

{
while (count--) {
if (decrypt){
decipher(cs, dst, src, NULL);
} else {
encipher(cs, dst, src);
}
src = src + 8;
dst = dst + 8;
}
}
